import React, { useEffect, useState } from "react";
import axios from "axios";

function AMAttendance() {
  const [employees, setEmployees] = useState([]);
  const [empID, setEmpID] = useState("");
  const [date, setDate] = useState("");
  const [checkInTime, setCheckInTime] = useState("");
  const [attendanceRecords, setAttendanceRecords] = useState([]);

  // Fetch all employee names & departments
  useEffect(() => {
    axios.get("http://localhost:5000/attendance/names-departments")
      .then((res) => setEmployees(res.data))
      .catch((err) => console.error("Error fetching employees", err));
  }, []);

  // Handle form submission to add attendance
  const handleSubmit = (e) => {
    e.preventDefault();

    axios.post("http://localhost:5000/attendance", {
      empID,
      recordedDate: date,
      checkInTime
    })
      .then(() => {
        alert("Attendance added!");
        setEmpID("");
        setDate("");
        setCheckInTime("");
        fetchAttendanceRecords(); // Refresh list
      })
      .catch((err) => alert("Error adding attendance"));
  };

  // Load attendance records
  const fetchAttendanceRecords = () => {
    axios.get("http://localhost:5000/attendance/records") // you should define this route to fetch all
      .then((res) => setAttendanceRecords(res.data))
      .catch((err) => console.error("Error loading records", err));
  };

  useEffect(() => {
    fetchAttendanceRecords();
  }, []);

  return (
    <div className="attendance-container">
      <h2>Attendance Manager</h2>

      <form onSubmit={handleSubmit}>
        <label>Employee Name</label>
        <select value={empID} onChange={(e) => setEmpID(e.target.value)} required>
          <option value="">--Select Employee--</option>
          {employees.map((emp) => (
            <option key={emp.empID} value={emp.empID}>
              {emp.name} ({emp.deptName})
            </option>
          ))}
        </select>

        <label>Date</label>
        <input type="date" value={date} onChange={(e) => setDate(e.target.value)} required />

        <label>Check-in Time</label>
        <input type="time" value={checkInTime} onChange={(e) => setCheckInTime(e.target.value)} required />

        <button type="submit">Add Attendance</button>
      </form>

      <h3>Attendance Records</h3>
      <table>
        <thead>
          <tr>
            <th>Employee</th>
            <th>Date</th>
            <th>Check-In</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {attendanceRecords.map((rec, index) => (
            <tr key={index}>
              <td>{rec.name}</td>
              <td>{rec.date}</td>
              <td>{rec.checkIn}</td>
              <td>
                <button>Edit</button>
                <button style={{ color: "red" }}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AMAttendance;
